import { Icon } from "../Icon/Icon";
import {
  Form,
  TopWrapper,
  Label,
  InputWrapper,
  Input,
  BottomWrapper,
  Text,
  FilterWrapper,
  FilterTitle,
  FilterList,
  FilterItem,
  Button
} from './SearchForm.styled'

export const SearchForm = () => {
  const vehicleEquipment = ['AC', 'Automatic', 'Kitchen', 'TV', 'Shower', 'WC'];
  const vehicleType = ['Van', 'Fully Integrated', 'Alcove']
  return (
    <Form>
      <TopWrapper>
        <Label for="adress">Location</Label>
        <InputWrapper>
          <Icon iconid={"icon-map-pin"} width={18} height={20} fill='var(--main-black-color)' />
          <Input placeholder="Kyiv, Ukraine" id='adress' />
        </InputWrapper>
      </TopWrapper>
      <BottomWrapper>
        <Text>Filters</Text>
        <FilterWrapper>
          <FilterTitle>Vehicle equipment</FilterTitle>
          <svg xmlns="http://www.w3.org/2000/svg" width="360" height="2" viewBox="0 0 360 2" fill="none">
<path d="M0 1H360" stroke="#101828" stroke-opacity="0.1"/>
</svg>
          <FilterList>
            {vehicleEquipment.map(el => {
              return <FilterItem key={el}>{el}</FilterItem>
            })}
          </FilterList>
        </FilterWrapper>
        <FilterWrapper>
          <FilterTitle>Vehicle type</FilterTitle>
          <FilterList>
          {vehicleType.map(el => {
              return <FilterItem key={el}>{el}</FilterItem>
            })}
          </FilterList>
        </FilterWrapper>
      </BottomWrapper>
      <Button>Search</Button>
    </Form>
  );
};
